import React from 'react'
import { useLocation } from 'react-router';
import { Col, Row, Menu, Dropdown, Avatar, Card, Button } from 'antd'
import { CaretDownOutlined, UserOutlined  } from '@ant-design/icons';
import { Link, Redirect, Route } from 'react-router-dom'
import MenuEvo from '../../components/MenuEvo/MenuEvo'
import { AiOutlineArrowLeft } from "react-icons/ai";

import { Layout } from 'antd';
import './LayoutSecondary.scss';

//const user = null;
const user = { id: 1, username: "Lupita Gamiño" }
const { Header, Content } = Layout;

export default function LayoutSecondary({title: Title, component: Component, ...rest}) {
    const location = useLocation();
    let backTo = location.pathname.split("-")

    const menu = (
        <Menu>
          <Menu.Item key="0">
            <Menu.Item key="3">Ver Perfil</Menu.Item>
          </Menu.Item>
          <Menu.Divider />
          <Menu.Item key="2">Cerrar sesión</Menu.Item>
        </Menu>
      );

     

    return (
        <Route {...rest}>
             {user ? 
             (<>
                
                <Layout>
                    <Row>
                        <Col span={2} className="menuSide">        
                            <MenuEvo />
                        </Col>
                    
                        <Col span={22} className="contentFrame">
                            <Header>
                               <div className="title">
                               <Link to={backTo[0]}><Button className="layoutBtn" style={{textAlign: "left", marginLeft: "-40px"}} icon={<AiOutlineArrowLeft className="iconAjust2 iconGreen"/>} > <span className="textAjust3">{Title}</span></Button></Link>
                               </div>
                                <div className="perfil">
                                    <Dropdown overlay={menu} trigger={['click']}>
                                        <Link to="" className="ant-dropdown-link" onClick={e => e.preventDefault()}>
                                        {user.username} <Avatar icon={<UserOutlined />} /> <CaretDownOutlined />
                                        </Link>
                                    </Dropdown>
                                </div>                                
                            </Header>
                            <Content>
                                <Card className="cardlayout">
                                    <Component/>
                                </Card>
                            </Content>
                        </Col>
                    </Row>
                </Layout> 
             
             </>) : (<Redirect to="/login" />) }
       </Route>
    )
}
